                     <div className="shping-img">
                         <img src= {img} className="img-fluid sp-img" alt="" />
                     </div>
                     <div className="sp-title">
                         <h2>{title}</h2>
                         <p>Black in Color</p>
                     </div>
                     <div className="conting-mngr">
                     <h1 className="spIncr">-</h1>
                     <input type="text" placeholder="0" className="cntng-input"/>
